import styled from "styled-components";

const
FooterWrapper = styled.div`
background-color: black;
display: flex;
justify-content: flex-end;
align-items: center;
`,
Footer = () => {
  return (
    <FooterWrapper>
      <p>created by ostrix</p>
    </FooterWrapper>
  );
};
